import {FormControlLabel, Radio, RadioGroup} from "@material-ui/core";
import React, {useEffect, useState} from "react";
import '../styles/components.css';
import {RadioType} from "../objects/enums/RadioType";
import {getTextsByType} from "../helpers/uiHelper";


export interface RadioConfigGroupProps {
    radioType: RadioType
}

const RadioConfigGroup = ({radioType}: RadioConfigGroupProps) => {
    const [texts, setTexts] = useState<string[]>(getTextsByType(radioType));

    useEffect(() => {
        setTexts(getTextsByType(radioType))
    }, [radioType])

    return (
        <div>
            <text className='radioTitle'>Twoja Matka</text>
            <RadioGroup>
                <FormControlLabel control={<Radio/>} label={texts[0]}/>
                <FormControlLabel control={<Radio/>} label={texts[1]}/>
                <FormControlLabel control={<Radio/>} label={texts[2]}/>
                <FormControlLabel control={<Radio/>} label={texts[3]}/>
            </RadioGroup>
        </div>
    );
}

export default RadioConfigGroup;
